(7443, NULL, 193, 392, NULL, '‚ú¶ Kesan\r\n\r\nSelama mengikuti pelatihan, saya merasakan pendamping selalu sabar, ramah, dan sigap membantu peserta. Penyampaian materi jelas, mudah dipahami, serta memberikan contoh yang relevan sehingga suasana pelatihan terasa menyenangkan dan tidak membosankan. Pendamping juga terbuka terhadap pertanyaan dan diskusi, sehingga kami merasa lebih percaya diri dalam memahami materi.\r\n\r\n‚ú¶ Pesan\r\n\r\nSemoga pendamping terus menjaga semangat dalam membimbing peserta dengan penuh kesabaran. Kami berharap pendamping tetap meningkatkan kualitas pendampingan, memberikan motivasi, dan terus membagikan pengalaman yang bermanfaat bagi peserta di pelatihan berikutnya', '2025-09-26 00:43:03', '2025-09-26 00:43:03'),
